fragment PersonInfoTiny on Person {
  id
  name
  __typename
}

query getMovie($id: String!) {
  movie(id: $id) {
    id
    title
    country
    type
    genres
    duration
    ratings {
      averageRating
      name
      __typename
    }
    releaseYear
    classification
    streamBy {
      name
      yearAdded
      __typename
    }
    produced {
      id {
        ...PersonInfoTiny
        __typename
      }
      __typename
    }
    directed {
      id {
        ...PersonInfoTiny
        __typename
      }
      __typename
    }
    cast {
      id {
        ...PersonInfoTiny
        __typename
      }
      as
      __typename
    }
    written {
      id {
        ...PersonInfoTiny
        __typename
      }
      __typename
    }
    crew {
      id {
        ...PersonInfoTiny
        __typename
      }
      as
      cat
      job
      __typename
    }
    awards {
      category
      festival {
        id
        name
        __typename
      }
      won
      year
      __typename
    }
    references {
      imdb
      __typename
    }
    image {
      poster
      __typename
    }
    boxOffice
    production
    language
    plot
    remakes {
      id
      title
      releaseYear
      directed {
        id {
          ...PersonInfoTiny
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}
